import './App.css';
import React from 'react';
import Container from 'react-bootstrap/Container';
import Navbar from 'react-bootstrap/Navbar';
import Nav from 'react-bootstrap/Nav';
import 'bootstrap/dist/css/bootstrap.min.css';
import {
  Route,
  NavLink,
  Routes,
  HashRouter
} from "react-router-dom";
import Login from './Login/Login';
import Registration from './Registtration/Registration';
import Products from './Product/Product';
import Mobiles from './Product/Mobiles';
import Oppo from './Product/oppo';
import Redme from './Product/redme';

function App() {
  return (
    <>
      <HashRouter>
        <div className="App">
          <Navbar bg="primary" variant='primary'>
            <Container fluid className='mx-4' >
              <Navbar.Brand ><b className='navItem'>Shopping Application</b></Navbar.Brand>
              <Nav className="header">
                <NavLink to='/'><b className='navItem mx-2'>Login</b></NavLink>
                <NavLink to='/Registration'><b className='navItem mx-2'>Registration</b></NavLink>
                <NavLink to='/Product'><b className='navItem mx-2'>Product</b></NavLink>
              </Nav>
            </Container>
          </Navbar>
          <div className="content">
            <Routes>
              <Route exact path='/' element={<Login />} />
              <Route path='/Registration' element={<Registration />} />
              <Route path='/Product' element={<Products />} >
                <Route path='Mobiles' element={<Mobiles />} >

                </Route>
                <Route path='oppo' element={<Oppo />} />
                <Route path='Redme' element={<Redme />} />
              </Route>


            </Routes>
          </div>

        </div>
      </HashRouter>
    </>
  );
}

export default App;
